ion)\n    # rdd = rdd.repartition(8).map_partitions(printt)\n    rdd = rdd.map(build_new_tiles).flatten()\n    rdd = rdd.foldby(key=lambda tile:(tile.x,tile.y),\n                    binop=aggregate_tile)\n    rdd.visualize(filename='flatMapreducebyKey.png')\n\n    with performance_report(filename=\"dask-report.html\"):\n        res = rdd.compute()\n\n\n    print(\"###############################################\")\n    conf = SparkConf()\n\n    conf.setMaster('local[3]')\n    sc = SparkContext(conf=conf)\n    print(sc)\n\n    rdd = sc.parallelize(collection)\n    rdd = rdd.flatMap(build_new_tiles)\n    rdd = rdd.map(lambda tile:((tile.x,tile.y), tile))\n    rdd = rdd.reduceByKey(aggregate_tile)\n    res = rdd.collect()\n    print(len(res))\n    print(\"###############################################\")\n    input(\"wait\")\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1007","type":"LinearScale"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1276"},"selection_policy":{"id":"1277"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{},"id":"1195","type":"CategoricalTicker"},{"attributes":{"axis":{"id":"1081"},"ticker":null,"visible":false},"id":"1084","type":"Grid"},{"attributes":{"axis":{"id":"1190"},"ticker":null},"id":"1193","type":"Grid"},{"attributes":{"months":[0,4,8]},"id":"1262","type":"MonthsTicker"},{"attributes":{"axis":{"id":"1085"},"dimension":1,"ticker":null,"visible":false},"id":"1088","type":"Grid"},{"attributes":{"axis":{"id":"1194"},"dimension":1,"ticker":null,"visible":false},"id":"1196","type":"Grid"},{"attributes":{"formatter":{"id":"1249"},"ticker":{"id":"1195"}},"id":"1194","type":"CategoricalAxis"},{"attributes":{},"id":"1086","type":"BasicTicker"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1065","type":"Quad"}
